import React from 'react';


import './Box.css' ;

function Box (){
  const [data, sepata] = useState([]);
  useEffect(() => {
    axios.get('http://localhost:8081/')
      .then(res => sepata(res.data))
      .catch(err => console.log(err))
  }, []);


  return (
            <>
                <div className="Box" >
                  {data.map((car, index) => {
              return <p key={index}>
                {car.numcar}
                {car.bran}
                {car.model}
                {car.note}
                
              </p>
            })}
            </div>
            </>
      
    
  );


}

export default Box;
